import ScrollToTop from './component/ScrollToTop.js';
import WorkAndSkills from './component/WrokAndSkills.js';

function App() {
  const isMobile = window.innerWidth <= 768;

  return (
    <div>
      <Header />

      <AboutMe />
      <WorkAndSkills/>
      <ContactForm />
      <ScrollToTop />
      <Footer />
    </div>
  );
}

